func TestByteSerialisation(t *testing.T) {
	for _, expTxByteStr := range txByteStrs {
		bs, err := hex.DecodeString(expTxByteStr)
		if err != nil {
			panic(err)
		}
		tx, err := FromBytes(bs)
		if assert.Nil(t, err) {
			bs := ToBytes(tx)
			txByteStr := hex.EncodeToString(bs)
			assert.Equal(t, expTxByteStr, txByteStr)
		}
	}
}
